import React from "react";
import "./style.css";

const Card = props => (
    <div className="card" onClick={props.picClick}>
        <div className="images">
            <img alt={ props.image.replace(".jpg", "")} src={require("../../images" + props.image)} />
        </div>
    </div>
);

export default Card;
